import {
  FETCH_POST_ERROR,
  FETCH_POST_REQUEST,
  FETCH_POST_SUCESS,
} from "../constants/postConstans";

export const loadPost = () => async (dispath) => {
  try {
    dispath({ type: FETCH_POST_REQUEST });

    const url = "https://jsonplaceholder.typicode.com/posts";
    const res = await fetch(url);
    const data = await res.json();

    dispath({ type: FETCH_POST_SUCESS, data });
  } catch (err) {
    dispath({ type: FETCH_POST_ERROR, message: err });
  }
};
